import React, { useState, useEffect } from 'react';
import { vitalsAPI } from '../../api/endpoints';

const ReadOnlyConsultationView = ({ consultation, onClose, currentUser }) => {
  const [vitals, setVitals] = useState(null);

  useEffect(() => {
    fetchVitals();
  }, []);

  const fetchVitals = async () => {
    try {
      if (consultation.patient_id) {
        const response = await vitalsAPI.getLatestVitals(consultation.patient_id);
        setVitals(response.data.vitals);
      }
    } catch (error) {
      console.error('Error fetching vitals:', error);
    }
  };

  const getExamData = () => {
    console.log('Full consultation object:', consultation);
    try {
      if (consultation.tests) {
        console.log('Raw tests data:', consultation.tests);
        const parsed = JSON.parse(consultation.tests);
        console.log('Parsed exam data:', parsed);
        return parsed;
      } else {
        console.log('No tests data found in consultation');
      }
    } catch (error) {
      console.error('Error parsing exam data:', error);
    }
    return null;
  };

  const examData = getExamData();
  console.log('Final exam data:', examData);
  const examType = examData?.od_visual_acuity ? 'eye' : examData?.right_ear ? 'ent' : examData?.affected_area ? 'skin' : 'unknown';
  console.log('Detected exam type:', examType);

  return (
    <div style={{
      position: 'fixed',
      top: 0,
      left: 0,
      right: 0,
      bottom: 0,
      background: 'rgba(0, 0, 0, 0.8)',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      zIndex: 1000,
      padding: '20px'
    }}>
      <div style={{
        background: '#1e1e2f',
        borderRadius: '12px',
        width: '90%',
        maxWidth: '800px',
        maxHeight: '90vh',
        overflow: 'auto',
        border: '1px solid #2a2d47'
      }}>
        <div style={{
          display: 'flex',
          justifyContent: 'space-between',
          alignItems: 'center',
          padding: '20px',
          borderBottom: '1px solid #2a2d47',
          background: '#2a2d47',
          borderRadius: '12px 12px 0 0'
        }}>
          <h3 style={{margin: 0, color: '#ffffff', fontSize: '18px'}}>
            {examType === 'eye' ? '👁 Eye' : examType === 'ent' ? '👂 ENT' : examType === 'skin' ? '🩺 Skin' : '🏥 General'} Examination - {new Date(consultation.created_at).toLocaleDateString('en-US', {timeZone: Intl.DateTimeFormat().resolvedOptions().timeZone})}
          </h3>
          <div style={{display: 'flex', gap: '10px', alignItems: 'center'}}>
            {currentUser?.role === 'admin' && (
              <button 
                onClick={() => {/* Delete functionality */}}
                style={{
                  background: '#ff4757',
                  border: 'none',
                  padding: '8px 12px',
                  borderRadius: '6px',
                  color: 'white',
                  fontSize: '12px',
                  fontWeight: '600',
                  cursor: 'pointer'
                }}
              >
                Delete
              </button>
            )}
            <button 
              onClick={onClose}
              style={{
                background: 'none',
                border: 'none',
                fontSize: '24px',
                cursor: 'pointer',
                color: '#ffa057',
                padding: '0',
                width: '30px',
                height: '30px',
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'center',
                borderRadius: '50%'
              }}
            >
              ×
            </button>
          </div>
        </div>

        <div style={{padding: '20px'}}>
          {/* Vital Signs Section */}
          {vitals && (
            <div style={{
              background: '#2a2d47',
              borderRadius: '8px',
              padding: '16px',
              marginBottom: '20px',
              border: '1px solid #3a3d5a'
            }}>
              <h4 style={{color: '#ffa057', margin: '0 0 12px 0'}}>Vital Signs</h4>
              <div style={{display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(150px, 1fr))', gap: '12px'}}>
                <div>
                  <label style={{color: '#b8bcc8', fontSize: '12px'}}>Blood Pressure</label>
                  <div style={{color: '#ffffff', fontWeight: '600'}}>{vitals.blood_pressure} mmHg</div>
                </div>
                <div>
                  <label style={{color: '#b8bcc8', fontSize: '12px'}}>Heart Rate</label>
                  <div style={{color: '#ffffff', fontWeight: '600'}}>{vitals.heart_rate} bpm</div>
                </div>
                <div>
                  <label style={{color: '#b8bcc8', fontSize: '12px'}}>Temperature</label>
                  <div style={{color: '#ffffff', fontWeight: '600'}}>{vitals.temperature}°C</div>
                </div>
                <div>
                  <label style={{color: '#b8bcc8', fontSize: '12px'}}>Weight</label>
                  <div style={{color: '#ffffff', fontWeight: '600'}}>{vitals.weight} kg</div>
                </div>
              </div>
            </div>
          )}

          {/* Examination Section */}
          {examType === 'eye' && (
            <div style={{display: 'grid', gridTemplateColumns: '1fr 1fr', gap: '20px', marginBottom: '20px'}}>
              <div style={{background: '#2a2d47', borderRadius: '8px', padding: '16px', border: '1px solid #3a3d5a'}}>
                <h4 style={{color: '#ffa057', margin: '0 0 12px 0'}}>Right Eye (OD)</h4>
                <div style={{display: 'grid', gap: '8px'}}>
                  <div><label style={{color: '#b8bcc8', fontSize: '12px'}}>Visual Acuity</label><div style={{color: '#ffffff', fontWeight: '600'}}>{examData?.od_visual_acuity || 'Not recorded'}</div></div>
                  <div><label style={{color: '#b8bcc8', fontSize: '12px'}}>Cornea</label><div style={{color: '#ffffff', fontWeight: '600'}}>{examData?.od_cornea || 'Not recorded'}</div></div>
                  <div><label style={{color: '#b8bcc8', fontSize: '12px'}}>Lens</label><div style={{color: '#ffffff', fontWeight: '600'}}>{examData?.od_lens || 'Not recorded'}</div></div>
                  <div><label style={{color: '#b8bcc8', fontSize: '12px'}}>Retina</label><div style={{color: '#ffffff', fontWeight: '600'}}>{examData?.od_retina || 'Not recorded'}</div></div>
                  <div><label style={{color: '#b8bcc8', fontSize: '12px'}}>Intraocular Pressure</label><div style={{color: '#ffffff', fontWeight: '600'}}>{examData?.od_pressure || 'Not recorded'}</div></div>
                  <div><label style={{color: '#b8bcc8', fontSize: '12px'}}>Refraction</label><div style={{color: '#ffffff', fontWeight: '600'}}>{examData?.od_refraction || 'Not recorded'}</div></div>
                </div>
              </div>
              <div style={{background: '#2a2d47', borderRadius: '8px', padding: '16px', border: '1px solid #3a3d5a'}}>
                <h4 style={{color: '#ffa057', margin: '0 0 12px 0'}}>Left Eye (OS)</h4>
                <div style={{display: 'grid', gap: '8px'}}>
                  <div><label style={{color: '#b8bcc8', fontSize: '12px'}}>Visual Acuity</label><div style={{color: '#ffffff', fontWeight: '600'}}>{examData?.os_visual_acuity || 'Not recorded'}</div></div>
                  <div><label style={{color: '#b8bcc8', fontSize: '12px'}}>Cornea</label><div style={{color: '#ffffff', fontWeight: '600'}}>{examData?.os_cornea || 'Not recorded'}</div></div>
                  <div><label style={{color: '#b8bcc8', fontSize: '12px'}}>Lens</label><div style={{color: '#ffffff', fontWeight: '600'}}>{examData?.os_lens || 'Not recorded'}</div></div>
                  <div><label style={{color: '#b8bcc8', fontSize: '12px'}}>Retina</label><div style={{color: '#ffffff', fontWeight: '600'}}>{examData?.os_retina || 'Not recorded'}</div></div>
                  <div><label style={{color: '#b8bcc8', fontSize: '12px'}}>Intraocular Pressure</label><div style={{color: '#ffffff', fontWeight: '600'}}>{examData?.os_pressure || 'Not recorded'}</div></div>
                  <div><label style={{color: '#b8bcc8', fontSize: '12px'}}>Refraction</label><div style={{color: '#ffffff', fontWeight: '600'}}>{examData?.os_refraction || 'Not recorded'}</div></div>
                </div>
              </div>
            </div>
          )}

          {examType === 'ent' && (
            <div style={{marginBottom: '20px'}}>
              <div style={{display: 'grid', gridTemplateColumns: '1fr 1fr', gap: '20px', marginBottom: '16px'}}>
                <div style={{background: '#2a2d47', borderRadius: '8px', padding: '16px', border: '1px solid #3a3d5a'}}>
                  <h4 style={{color: '#ffa057', margin: '0 0 12px 0'}}>Right Ear</h4>
                  <div style={{display: 'grid', gap: '8px'}}>
                    <div><label style={{color: '#b8bcc8', fontSize: '12px'}}>Examination</label><div style={{color: '#ffffff', fontWeight: '600'}}>{examData?.right_ear || 'Not recorded'}</div></div>
                  </div>
                </div>
                <div style={{background: '#2a2d47', borderRadius: '8px', padding: '16px', border: '1px solid #3a3d5a'}}>
                  <h4 style={{color: '#ffa057', margin: '0 0 12px 0'}}>Left Ear</h4>
                  <div style={{display: 'grid', gap: '8px'}}>
                    <div><label style={{color: '#b8bcc8', fontSize: '12px'}}>Examination</label><div style={{color: '#ffffff', fontWeight: '600'}}>{examData?.left_ear || 'Not recorded'}</div></div>
                  </div>
                </div>
              </div>
              <div style={{display: 'grid', gridTemplateColumns: '1fr 1fr 1fr', gap: '20px'}}>
                <div style={{background: '#2a2d47', borderRadius: '8px', padding: '16px', border: '1px solid #3a3d5a'}}>
                  <h4 style={{color: '#ffa057', margin: '0 0 12px 0'}}>Nose</h4>
                  <div style={{display: 'grid', gap: '8px'}}>
                    <div><label style={{color: '#b8bcc8', fontSize: '12px'}}>Examination</label><div style={{color: '#ffffff', fontWeight: '600'}}>{examData?.nose_exam || 'Not recorded'}</div></div>
                  </div>
                </div>
                <div style={{background: '#2a2d47', borderRadius: '8px', padding: '16px', border: '1px solid #3a3d5a'}}>
                  <h4 style={{color: '#ffa057', margin: '0 0 12px 0'}}>Throat</h4>
                  <div style={{display: 'grid', gap: '8px'}}>
                    <div><label style={{color: '#b8bcc8', fontSize: '12px'}}>Examination</label><div style={{color: '#ffffff', fontWeight: '600'}}>{examData?.throat_exam || 'Not recorded'}</div></div>
                  </div>
                </div>
                <div style={{background: '#2a2d47', borderRadius: '8px', padding: '16px', border: '1px solid #3a3d5a'}}>
                  <h4 style={{color: '#ffa057', margin: '0 0 12px 0'}}>Hearing Test</h4>
                  <div style={{display: 'grid', gap: '8px'}}>
                    <div><label style={{color: '#b8bcc8', fontSize: '12px'}}>Results</label><div style={{color: '#ffffff', fontWeight: '600'}}>{examData?.hearing_test || 'Not recorded'}</div></div>
                  </div>
                </div>
              </div>
            </div>
          )}

          {examType === 'skin' && (
            <div style={{display: 'grid', gridTemplateColumns: '1fr 1fr', gap: '20px', marginBottom: '20px'}}>
              <div style={{background: '#2a2d47', borderRadius: '8px', padding: '16px', border: '1px solid #3a3d5a'}}>
                <h4 style={{color: '#ffa057', margin: '0 0 12px 0'}}>Affected Area</h4>
                <div style={{display: 'grid', gap: '8px'}}>
                  <div><label style={{color: '#b8bcc8', fontSize: '12px'}}>Area</label><div style={{color: '#ffffff', fontWeight: '600'}}>{examData?.affected_area || 'Not recorded'}</div></div>
                  <div><label style={{color: '#b8bcc8', fontSize: '12px'}}>Lesion Type</label><div style={{color: '#ffffff', fontWeight: '600'}}>{examData?.lesion_type || 'Not recorded'}</div></div>
                </div>
              </div>
              <div style={{background: '#2a2d47', borderRadius: '8px', padding: '16px', border: '1px solid #3a3d5a'}}>
                <h4 style={{color: '#ffa057', margin: '0 0 12px 0'}}>Appearance</h4>
                <div style={{display: 'grid', gap: '8px'}}>
                  <div><label style={{color: '#b8bcc8', fontSize: '12px'}}>Color/Texture</label><div style={{color: '#ffffff', fontWeight: '600'}}>{examData?.color_texture || 'Not recorded'}</div></div>
                  <div><label style={{color: '#b8bcc8', fontSize: '12px'}}>Symptoms</label><div style={{color: '#ffffff', fontWeight: '600'}}>{examData?.symptoms || 'Not recorded'}</div></div>
                </div>
              </div>
            </div>
          )}

          {/* Clinical Findings */}
          <div style={{
            background: '#2a2d47',
            borderRadius: '8px',
            padding: '16px',
            marginBottom: '20px',
            border: '1px solid #3a3d5a'
          }}>
            <h4 style={{color: '#ffa057', margin: '0 0 12px 0'}}>Clinical Findings</h4>
            <div style={{display: 'grid', gap: '12px'}}>
              <div>
                <label style={{color: '#b8bcc8', fontSize: '12px'}}>Symptoms (Chief Complaint)</label>
                <div style={{color: '#ffffff', fontWeight: '600', padding: '8px', background: '#1e1e2f', borderRadius: '4px'}}>
                  {consultation.symptoms || 'No symptoms recorded'}
                </div>
              </div>
              <div>
                <label style={{color: '#b8bcc8', fontSize: '12px'}}>Diagnosis</label>
                <div style={{color: '#ffffff', fontWeight: '600', padding: '8px', background: '#1e1e2f', borderRadius: '4px'}}>
                  {consultation.diagnosis}
                </div>
              </div>
              <div>
                <label style={{color: '#b8bcc8', fontSize: '12px'}}>Prescription</label>
                <div style={{color: '#ffffff', fontWeight: '600', padding: '8px', background: '#1e1e2f', borderRadius: '4px'}}>
                  {consultation.prescription || 'No prescription given'}
                </div>
              </div>
              <div>
                <label style={{color: '#b8bcc8', fontSize: '12px'}}>Clinical Notes</label>
                <div style={{color: '#ffffff', fontWeight: '600', padding: '8px', background: '#1e1e2f', borderRadius: '4px'}}>
                  {consultation.notes || 'No additional notes'}
                </div>
              </div>
            </div>
          </div>

          {/* Billing Information */}
          <div style={{
            background: '#2a2d47',
            borderRadius: '8px',
            padding: '16px',
            border: '1px solid #3a3d5a'
          }}>
            <h4 style={{color: '#ffa057', margin: '0 0 12px 0'}}>Billing Information</h4>
            <div style={{display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(150px, 1fr))', gap: '12px'}}>
              <div>
                <label style={{color: '#b8bcc8', fontSize: '12px'}}>Consultation Fee</label>
                <div style={{color: '#ffffff', fontWeight: '600'}}>KSH {consultation.amount}</div>
              </div>
              <div>
                <label style={{color: '#b8bcc8', fontSize: '12px'}}>Date & Time</label>
                <div style={{color: '#ffffff', fontWeight: '600'}}>{new Date(consultation.created_at).toLocaleString('en-US', {timeZone: Intl.DateTimeFormat().resolvedOptions().timeZone})}</div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ReadOnlyConsultationView;
